import React from 'react';
import MakeList from './makelist';

function ToDoList({ toDos }) {
  console.log(toDos)
  return (
    <div>
      <h1>Your To Do List ({toDos.length})</h1>
      <MakeList />
    </div>
  );
}

export default ToDoList;
